import React from 'react';

export const Logo: React.FC<{ className?: string }> = ({ className = "h-12" }) => {
  /**
   * BASE64 LOGO CONFIGURATION:
   * Paste your base64 string inside the quotes for 'base64Data'.
   * If 'base64Data' is empty, the component will attempt to load '/logo.png'.
   */
  const base64Data = "data:image/png;base64,"; 
  
  const logoUrl = base64Data || "/logo.png"; 

  return (
    <div className={`flex items-center justify-center overflow-visible ${className}`}>
      <img 
        src={logoUrl} 
        alt="TARP Logo" 
        className="h-full w-auto object-contain transition-opacity duration-300"
        onError={(e) => {
          /**
           * FALLBACK:
           * If neither the base64 string nor the image file is valid,
           * we render a high-end typography-based logo.
           */
          const target = e.currentTarget;
          const parent = target.parentElement;
          if (parent) {
            target.style.display = 'none';
            parent.innerHTML = `
              <div class="flex flex-col items-center justify-center text-center">
                <span class="font-bold text-slate-900 text-[1.5em] tracking-[-0.05em] leading-none mb-1">TARP</span>
                <span class="text-[0.35em] text-cyan-600 font-black uppercase tracking-[0.4em] leading-none border-t border-slate-100 pt-1">
                  The Animal Rescue Project
                </span>
              </div>
            `;
          }
        }}
      />
    </div>
  );
};